 SEN_door_africa_desc:0 "From the last outpost of the French colonial empire, Senegal is now the first of the new African sister nations of the new French Revolution. From Dakar, the League Solar is sending weapons to allied militias across the continent, while a new generation is being trained in its schools to spread the word of futurism to the Black Continent."